import React from "react";
import styled from "styled-components";
import "./index.css";
import { FaUser, FaShoppingCart } from "react-icons/fa";

const Header = styled.div`
  border: 2px solid black;
`;

const LogoNav = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  height: 77px;
  background-color: #f6f7fc;
  overflow: hidden;
  box-shadow: 0px -1px 5px grey;
`;

const Logo = styled.img`
  width: 220px;
`;

const Nav = styled.nav``;

const Dropdown = styled.div``;

const IndexComponent = () => {
  return (
    <>
      {/* write html tag as plain tag */}
      {/* &lt;h1&gt;hjhgkjhgk&lt;/h1&gt; */}
      <Header>
        <LogoNav>
          <Logo src="/images/materiallibrarylogo.png" alt="mlLogo"></Logo>

          {/* <ul className='indexUl'>
                        <li className='indexLi'>Portfolios</li>
                        <li className='indexLi'>Tutorials</li>
                        <li className='indexLi'>Jobs</li>
                        <li className='indexLi'><input className='indexLanguage' type="text" placeholder='Select Language' /></li>
                        <li className='indexLi'><FaUser /></li>
                        <li className='indexLi'><FaShoppingCart /></li>


                    </ul> */}
                    <Dropdown>
  <Dropdown.Toggle variant="success" id="dropdown-basic">
    Dropdown Button
  </Dropdown.Toggle>

  <Dropdown.Menu>
    <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
    <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
    <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
  </Dropdown.Menu>
</Dropdown>
            

        </LogoNav>
        <Nav></Nav>
      </Header>
    </>
  );
};

export default IndexComponent;
